import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      light: '#7c9c99',
      main: '#b2dfdb',
      dark: '#c1e5e2',
      contrastText: '#fff',
    },
    secondary: {
      light: '#ad8291',
      main: '#f8bbd0',
      dark: '#f9c8d9',
      contrastText: '#000',
    },
  },
});

export default theme;
